    <style>
        @import url("https://fonts.googleapis.com/css?family=Roboto:400,400i,700");

        body {
            font-family: "Roboto", Sans-Serif;
            margin: 0;
            padding: 0; /* Add padding to the body */
        }

        /* Make the image full-page */
        .main-image {
            height: auto; /* Set the height of the image to the full viewport height */
            width: 100%;
            overflow: hidden;
            /* position: relative; */
        }

        .main-image img {
            width: 100%; /* Make the image take full width */
            height: auto; /* Maintain aspect ratio */
            object-fit: cover; /* Cover the entire container */
            /* position: absolute; */
            top: 0;
            left: 0;
        }

        /* Adjust padding for small screens */
        .social-tabs {
            padding-top: 1rem;
            display: flex;
            flex-wrap: wrap;
            padding: 1rem;
            /* margin-top: -24%; */
        }

        .social-tabs a {
            line-height: 4;
            background: #ccc;
            text-align: center;
            flex: 1 1 0%;
            color: #fff;
            text-decoration: none;
            font-weight: bold;
            text-transform: uppercase;
            font-size: 14px;
            text-shadow: 1px 1px 1px rgba(25, 25, 25, 0.5);
            letter-spacing: 1px;
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 0 10px;
            margin: 5px; /* Add margin for better spacing */
        }

        .social-tabs a i {
            font-size: 24px;
            margin-right: 5px;
        }

        .social-tabs a.facebook-tab {
            background: linear-gradient(135deg, #f9ce34 0%, #ee2a7b 50%, #6228d7 100%);
        }

        .social-tabs a.linkedin-tab {
            background: #25D366;
        }

        .social-tabs a.dribble-tab {
            background: #CD201F;
        }

        .social-title {
            margin-top: -26%;
            text-align: center;
            text-transform: capitalize;
            padding: 5px 26px 0px 26px;
        }
        .social-title p{
            font-family: 'Font Awesome 5 Brands';
            font-size: large;
        }

    </style>
